css:
/*
* This is sortof prepared for adjustable themes.
* Everything is based of a single color taken from the syntax theme.
*/
.archive-editor {
  background-color: #232525;
  overflow: auto;
}
.archive-editor .archive-container {
  height: 100%;
  width: 100%;
}
.archive-editor .archive-container .inset-panel {
  border-width: 0;
}
.archive-editor .archive-container .inset-panel .panel-heading {
  border-radius: 0;
}
.archive-editor .archive-container .archive-tree {
  padding: 5px;
}
